import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

function QuizListTable() {
    const [quizzes, setQuizzes] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://127.0.0.1:8000/api/quizzes/');
                console.log("Fetched quizzes data:", response.data);
                // Handle both array and paginated object response
                if (Array.isArray(response.data)) {
                    setQuizzes(response.data);
                } else if (response.data.results) {
                    setQuizzes(response.data.results);
                } else {
                    setQuizzes([]);
                }
            } catch (error) {
                console.error("Fetch error:", error);
                setError(error);
            } finally {
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    if (loading) {
        return (
            <div className="d-flex justify-content-center m-5">
                <div className="spinner-border" role="status">
                    <span className="visually-hidden">Loading...</span>
                </div>
            </div>
        );
    }

    if (error) {
        return (
            <div className="alert alert-danger m-3" role="alert">
                Error loading quizzes: {error.message}
            </div>
        );
    }

    return (
        <div className="container-fluid py-4">
            <div className="row">
                <div className="col-12">
                    <div className="card shadow-sm">
                        <div className="card-header bg-light">
                            <h5 className="card-title mb-0">Available Quizzes</h5>
                        </div>
                        <div className="card-body">
                            <div className="table-responsive">
                                <table className="table table-hover table-striped">
                                    <thead>
                                        <tr>
                                            <th scope="col">#</th>
                                            <th scope="col">Title</th>
                                            <th scope="col">Description</th>
                                            <th scope="col">Created</th>
                                            <th scope="col">Questions</th>
                                            <th scope="col">Actions</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {quizzes.map((quiz) => (
                                            <tr key={quiz.id}>
                                                <td>{quiz.id}</td>
                                                <td>{quiz.title}</td>
                                                <td>{quiz.description}</td>
                                                <td>{new Date(quiz.created_At).toLocaleDateString()}</td>
                                                <td>{quiz.questions ? quiz.questions.length : 0}</td>
                                                <td>
                                                    <button className="btn btn-sm btn-primary">
                                                        Take Quiz
                                                    </button>
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default QuizListTable;
